import React from 'react'
import './Card.css'
import { motion , AnimatePresence} from "framer-motion"


export default function Home() {
    const pageVariants = {
        initial: {
          opacity: 0,
          x: "-100vw",
          scale: 0.8
        },
        in: {
          opacity: 1,
          x: 0,
          scale: 1
        },
        out: {
          opacity: 0,
          x: "100vw",
          scale: 1.2
        }
      };
      
      const pageTransition = {
        type: "tween",
        ease: "anticipate",
        duration: 0.5
      };
      
      const pageStyle = {
        position: "absolute"
      };
    return (
        <motion.div
            style={{position:"absolute"}}
            initial="initial"
            animate="in"
            exit="out"
            variants={pageVariants}
            transition={pageTransition}
            className="Card"
        >
            <div>
                ESTO ES EL HOME 
            </div>
        </motion.div>
    );
  }
